// ==UserScript==
// @name           IBMDb - IMDb rating inverter
// @namespace      eu.hermanussen.ibmdb
// @description    Internet Bobby Movie Database - My friend Bobby likes bad movies... so I made this script to invert the ratings on IMDB!
// @include        http://www.imdb.com*
// ==/UserScript==

function getElementsByClassName(oElm, strTagName, strClassName) {
    var arrElements = (strTagName == "*" && document.all)? document.all : oElm.getElementsByTagName(strTagName);
    var arrReturnElements = new Array();
    strClassName = strClassName.replace(/\-/g, "\\-");
    var oRegExp = new RegExp("(^|\\s)" + strClassName + "(\\s|$)");
    var oElement;
    for(var i=0; i<arrElements.length; i++){
        oElement = arrElements[i];
        if(oRegExp.test(oElement.className)){
            arrReturnElements.push(oElement);
        }
    }
    return (arrReturnElements)
}

var lStarbarMeta = getElementsByClassName(document, "div", "starbar-meta");
for(var i = 0; i < lStarbarMeta.length; i++) {
    var lBolds = lStarbarMeta[i].children;
    for(var j = 0; j < lBolds.length; j++) {
        if (lBolds[j].nodeName.toString() == "B" && lBolds[j].innerHTML.indexOf("/") > 0) {
            var lOriginalScore = parseFloat(lBolds[j].innerHTML.substring(0, lBolds[j].innerHTML.indexOf("/")));
            var lBobbyScore = (100 - (parseFloat(10.0) * lOriginalScore)) / 10.0;
            lBolds[j].innerHTML = lBobbyScore + "/10";
            var lVotingStars = document.getElementById("general-voting-stars");
            if (lVotingStars != null) lVotingStars.style.width = lBobbyScore * 20 + "px";
        }
    }
}

